import React from "react";

const ReadOnlyRow = ({ contact, handleDeleteClick }) => {
  return (
    <tr>
      <td>{contact.Name}</td>
      <td>{contact.Size}</td>
      <td>{contact.Dates}</td>
      <td>
        {" "}
        <p className="buttonDelete">
          <i
            class="bx bxs-download"
            style={{ fontSize: "50px", cursor: "pointer" }}
          ></i>
        </p>
      </td>

      <td>
        <p className="buttonDelete">
          <i
            class="bx bx-trash"
            onClick={() => handleDeleteClick(contact.id)}
            style={{ fontSize: "50px", cursor: "pointer", color: "black" }}
          ></i>
        </p>
      </td>
    </tr>
  );
};

export default ReadOnlyRow;
